import LogoIcon from "./icons/logo";
import SearchIcon from "./icons/search";
import WishlistIcon from "./icons/wishlist";
import CartIcon from "./icons/cart";

function App(props) {
  return (
    <>
      <Header />
      {props.children}
      <Footer />
    </>
  );
}

function Header() {
  return (
    <div className="flex justify-between items-center border px-8 py-2 scale-50">
      <LogoIcon />
      <div className="flex items-center">
        <ul className="flex *:mr-6">
          <li>New x Featured</li>
          <li>Men</li>
          <li>Women</li>
        </ul>
        <div className="flex gap-2 bg-gray-100 hover:bg-gray-200 rounded-3xl p-1.5">
          <SearchIcon />

          <input
            className="bg-transparent"
            style={{ outline: "none", maxWidth: "12vw" }}
            name="search"
            placeholder="Search"
          />
        </div>
        <div className="flex *:ml-4">
          <button className="rounded-2xl p-1.5 hover:bg-gray-200">
            <WishlistIcon />
          </button>
          <button className="rounded-2xl p-1.5 hover:bg-gray-200">
            <CartIcon />
          </button>
        </div>
      </div>
    </div>
  );
}

function Footer() {
  return <footer>Footer</footer>;
}

export default App;
